function addStudentsForInstitute(
    address _instituteAddress,
    string memory _instituteName,
    string[] memory _names,
    string[] memory _emails,
    string[] memory _dateOfBirths,
    string[] memory _mentions,
    string[] memory _dateRemiseDiplomes,
    string[] memory _numCINs,
    string[] memory _diplomas,
    string[] memory _ipfsHashes,
    string[] memory _diplomaIds
) public {
    require(
        _names.length == _emails.length &&
        _names.length == _dateOfBirths.length &&
        _names.length == _mentions.length &&
        _names.length == _dateRemiseDiplomes.length &&
        _names.length == _numCINs.length &&
        _names.length == _diplomas.length &&
        _names.length == _ipfsHashes.length &&
        _names.length == _diplomaIds.length,
        "Array lengths do not match."
    );

    for (uint i = 0; i < _names.length; i++) {
        // Crer un nouvel tudiant pour chaque lment dans les tableaux
        Student memory newStudent = Student({
            institutename: _instituteName,
            name: _names[i],
            email: _emails[i],
            dateOfBirth: _dateOfBirths[i],
            mention: _mentions[i],
            dateRemiseDiplome: _dateRemiseDiplomes[i],
            numCIN: _numCINs[i],
            diploma: _diplomas[i],
            ipfsHash: _ipfsHashes[i],
            id: _diplomaIds[i],
            validated: "Pending"
        });
        // Require conditions to check before modifying state variables
        require(msg.sender == _instituteAddress,"pas auto");
        // Add the student to the corresponding list for the institute
        instituteToStudents[_instituteAddress].push(newStudent);
        studentsById[_diplomaIds[i]] = newStudent;
        studentByCin[_numCINs[i]] = newStudent;
    }
}


